n tin', '', 'publish', 'closed', 'closed', '', 'dang-ky-nhan-tin', '', '', '2019-06-07 15:25:34', '2019-06-07 08:25:34', '', 0, 'http://127.0.0.1/kientruc/?post_type=wpcf7_contact_form&p=169', 0, 'wpcf7_contact_form', '', 0),
